def similar(a, b):
	return SequenceMatcher(None, a, b).ratio()

def avg(list):
	sum = 0
	for elm in list:
		sum += elm[0]
	return sum/(len(list)*1.0)

def mode(list):
	
	d = {}
	for elm in list:
		try:
			d[elm[0]] += 1
		except(KeyError):
			d[elm[0]] = 1
	
	keys = d.keys()
	max = d[keys[0]]
	
	for key in keys[1:]:
		if d[key] > max:
			max = d[key]

	max_k = []		
	for key in keys:
		if d[key] == max:
			max_k.append(key),
	return max_k,max



